    constructor(props: Props) {
        super(props);
    }
    
    render() {
        return (

            <BrowserRouter>
                <div>
                    <p>Wybierz opcjÄ™ w menu opartym na komponentach klasowych:</p>
                    <ul>
                        <li><Link to='/'>FirstApp</Link></li>
